import React, { useState } from "react";

import "./ExpenseForm.css";

const Chart = (props) => {
  const [addNewExpenses, setAddNewExpenses] = useState(false);

  const addNewExpensesHandler = (prevState) => {
    if (prevState === false) {
      setAddNewExpenses(true);
    } else {
      setAddNewExpenses(false);
    }
    console.log("Add Click");
    console.log();
  };

  const submitHandler = (event) => {
    event.preventDefault();

    console.log(addNewExpenses);
    // props.onSaveExpenseData(expenseData);
    props.onAddNewExpenses();
  };

  return (
    <form onSubmit={submitHandler}>
      <div>
        <button
          className="new-expense__actions"
          onClick={addNewExpensesHandler}
        >
          Add new Expenses
        </button>
      </div>
    </form>
  );
};

export default Chart;
